def comparar_convergencia(error_conjugado, error_Descendente,
                          iter_conjugado=None, iter_Descendente=None):
    """
    Grafica y compara las convergencias de Jacobi, Gauss-Seidel y Richardson
    con anotaciones en recuadros que muestran métricas clave.
    
    Parámetros opcionales de métricas:
      - iter_*: número de iteraciones hasta converger
      - tiempo_*: tiempo total de ejecución
    """
    fig, ax = plt.subplots(figsize=(10, 6))
    
    # Plot de las tres curvas
    ax.semilogy(error_conjugado,     linestyle='-', marker='o', markersize=4, label='Conjugado')
    ax.semilogy(error_Descendente,      linestyle='-', marker='o', markersize=4, label='Descendente')
    
    
    ax.set_xlabel('Iteración', fontsize=12)
    ax.set_ylabel('Error máximo (log)', fontsize=12)
    ax.set_title('Convergencia: Gradiente Conjugado vs Descendente', fontsize=14)
    ax.grid(True, which='both', linestyle='--', alpha=0.7)
    ax.legend()
    
    # Anotaciones al final de cada curva
    n_j, n_g= len(error_conjugado), len(error_Descendente)

    ax.annotate(f"{error_conjugado[-1]:.2e}",
                xy=(n_j-1, error_conjugado[-1]),
                xytext=(5, 0), textcoords='offset points',
                va='center', fontsize=10,
                bbox=dict(boxstyle='round,pad=0.3', fc='white', alpha=0.8))
    
    ax.annotate(f"{error_Descendente[-1]:.2e}",
                xy=(n_g-1, error_Descendente[-1]),
                xytext=(5, 0), textcoords='offset points',
                va='center', fontsize=10,
                bbox=dict(boxstyle='round,pad=0.3', fc='white', alpha=0.8))

    # Recuadro comparativo con métricas
    if any(x is not None for x in 
           [iter_conjugado, iter_Descendente]):
        text = ""
        text += "Metricas de convergencia:\n"
        if iter_conjugado is not None:
            text += f"Conjugado: {iter_conjugado} iters"
            text += "\n"

        if iter_Descendente is not None:
            text += f"Descendente: {iter_Descendente} iters"
            text += "\n"
        
        # Insertar cuadro en la esquina superior izquierda
        ax.text(0.02, 0.98, text, transform=ax.transAxes,
                fontsize=10, va='top', ha='left',
                bbox=dict(boxstyle='round,pad=0.5', fc='white', alpha=0.9))
    
    plt.tight_layout()
    plt.show()


